import React, { Component } from 'react';
import './Content.css'

class Service extends Component {

    render() {
        return (
        <div className="block">
            <br/>
            <h1>Service</h1>
           <h1>eiei</h1>
           <img src = "https://xtravelgear.com/wp-content/uploads/2018/04/x-bg.jpg"/>
        </div>
        );
    }
}
export default Service;
